import React from 'react';
import Head from 'next/head';
import { AppLayout, ConnectionList, NicknameEditform } from '../components';

const Profile = () => {
  return (
    <div>
      <Head>
        <title>Profile | Next Tweet</title>
      </Head>
      <AppLayout>
        <NicknameEditform />
        <ConnectionList title='Following' data />
        <ConnectionList title='Follower' data />
      </AppLayout>
    </div>
  );
};

export default Profile;
